function ToDo({todo, toggleTask, removeTask}) {
    return (
        <div key = {todo.id} className="item-todo">
            <div 
                className= {todo.complete ? "item-text strike" : "item-text"}
                onClick={()=> toggleTask(todo.id)}
            >
                {todo.task}
            <div 
                className="item-delate"
                onClick={()=> removeTask(todo.id)}
            >
                    X
                </div>
            </div>
        </div>
    )
    }

export default ToDo;
